import React from "react";

import {Navbar, Nav} from "react-bootstrap";

class NavigationBar extends React.Component{
    render() {
        return (
            <Navbar bg="dark" variant="dark">
                <Navbar.Brand href="/">
                    <img src="https://upload.wikimedia.org/wikipedia/en/2/24/H-Store-logo.png" width="25" height="25"
                         alt="brand"/>
                        Hotels
                </Navbar.Brand>
                <Nav className="mr-auto">
                    <Nav.Link href="/">Add hotel</Nav.Link>
                    <Nav.Link href="/">Hotel list</Nav.Link>
                    <Nav.Link href="/">Add Guest</Nav.Link>
                    <Nav.Link href="/">Guest list</Nav.Link>
                    <Nav.Link href="/">Add reservation</Nav.Link>
                    <Nav.Link href="/">Reservation list</Nav.Link>
                    <Nav.Link href="/">Add room</Nav.Link>
                    <Nav.Link href="/">Room list</Nav.Link>
                    <Nav.Link href="/">Add worker</Nav.Link>
                    <Nav.Link href="/">Workers list</Nav.Link>
                </Nav>
            </Navbar>
        );
    }
}

export default NavigationBar;
